ure, Attack on Titan (Shingeki no Kyojin), Fullmetal Alchemist, Hunter x Hunter, Dr Stone, Sword Art Online, Fairy Tail, Great Teacher Onizuka, Sailor Moon, Nana, Yu Yu Hakusho,  Ken le Survivant, Cowboy Bebop, Nicky Larson (City Hunter), Yu-Gi-Oh!, Berserk, Saint Seiya, Death Note, One-Punch Man, c\'est déjà une belle liste là.','2020-01-12T12:09:31Z',98200),('UC-Diq5SjWZDol8C0_E_1Y7A','BigSchool','I make monster school minecraft girl vs boy. Minecraft monster school animation funny and cute. Minecraft school for everyone !','2019-08-13T15:23:16Z',1000000),('UC-FWBPu6Aa4Vi24Ej6Awj6Q','Sulivan Gwed','Positivity (:\n\nInstagram - @SulivanGwed\nTwitter - @SulivanGwed\nSnapChat - SulivanGwed\n\nBusiness - sulivan@foll-ow.com','2014-04-05T19:14:23Z',1690000),('UC-fWGfiX-T1YdqaUZvMJBHg','宇宙となかよし/Qさん','【石田　久二（いしだひさつぐ）】\n\n1973年大阪府生まれ。福岡県在住。メンタルコーチ、講師、旅人、株式会社アンサー代表取締役。各種研修、夢実現のライブセッションを主宰。月間30万PVを集める人気ブロガーとしても知られる。\n\n大学卒業後、世界を放浪し、大学院、ニート、契約社員を経て2005年に独立。その前年から始めたブログは16年間毎日更新。「宇宙の法則」の実践により、収入、時間、家族、仲間、健康のすべてを満たしたライフスタイルを実現。\n\n2004年より天台修験の導師に師事し、在家ながらも本格的な密教の修行に勤しみ、滝行はこれまで1,600回以上に及ぶ。\n\n科学的根拠に基づく緻密な理論体系と、魂を揺さぶるエモーショナルな講演スタイルには定評があり、幅広い層に熱烈な人気を博している。全国の商工会議所、企業、学校からの講演依頼も多く、近年はアジアを中心に海外にも活動の幅を広げている。\n\nまた、訪問歴53か国の現役の旅人でもあり、近年は自転車を漕ぎながらの講演会にも力を入れ、日本の各都市のみならず韓国・ソウルでも講演会を開催。\n\n著書に、『僕らの魂が地球に放り込まれた理由』（KADOKAWA）、『夢がかなうとき、「なに」が起こっているのか？』『運がいいとき、「なに」が起こっているのか？』（いずれもサンマーク出版）、『「言葉」が人生を変えるしくみ　その最終結論。』（Clover出版）、監訳書に『人生がうまくいく人の断る力』（アチーブメント出版）などがある。\n\n\n【キーワード】\n宇宙となかよし、石田久二、Qさん、スピリチュアル、精神世界、自己啓発、仏教、密教、滝行、願望実現、引き寄せ、潜在意識、超意識、出版、ブログ、ユーチューブ、旅、インド、久高島、世界一周、放浪、自転車、音楽、ジャズ、クラリネット、モーツァルト\n\n■2nd「かたみち切符／Qさん」\n　http://bit.ly/2GI1fjp\n\n【YouTube経緯】\n2018年\n　8/10　初投稿\n2019年\n　1/12　500人\n　3/25　1,000人\n　4/10　5,000人\n　4/19　10,000人\n　6/5　20,000人\n　11/24　50,000人\n2020年\n　9/6　100,000人','2018-08-06T13:04:42Z',101000),('UC-hM6YJuNYVAmUWxeIr9FeA','Miko Ch. さくらみこ','ホロライブプロダクション所属▶︎ さくらみこ（Sakura Miko）です！\n\n３月５日生まれ / 153㎝ / 2018年8月1日にデビュー?\n\nキャラクターデザイン：田中雄一 先生\n新衣装デザイン：おるだん 先生\n\n\n【Story】\n電脳世界での巫女として真面目