ss with \"Milano\" and \"Guérilla\" before a phenomenal success with \"Dalida\", an homage to the singer Dalida, incorporating music from her single \"Parole Parole\". On 2 November 2018, Soolking released his debut solo album Fruit du démon that was certified Gold in France. The singles \"Guérilla\" and \"Dalida\" were certified Platinum.','2016-05-16T10:54:45Z',81000),('UC1P7sORcxLksdIdLPe_B2Ag','Paris Street Racing','Paris Street Racing c\'est quoi ?\n\nC\'est une association, que dis-je, une FAMILLE basée sur une passion commune, l\'automobile.\nOui dans cette famille, nous sommes tous des amoureux de ces œuvres d\'art sur quatre roues ...\n\n\nLe président Jordan Lapelosa, son vice-président Lio Céléstine , ainsi que la trentaine de membres du staff se tiennent connectés et disponibles au maximum afin de toujours vous renseigner, vous épauler, vous informer ou tout simplement pour vous amuser ! Car oui chez PSR, on adore s\'amuser (comme dans toutes les familles me direz-vous !)\n\n\nAfin de faire vivre cette famille, nous organisons régulièrement de nombreuses activités','2014-07-29T19:19:34Z',55200),('UC1pQqx5hxj-7brqpaJI_QiQ','روتيني اليومي مع سوحليفه','قناة للترفيه والترويح عن النفس لا تنسى دعم بلايك وتتابع القناة لكي يصلك كل جديد ونستمر في تقديم الجديد دائما مشكورين أحبابي','2019-11-22T07:01:52Z',0),('UC1q7LRamyojZuAbhsBWWgAA','Ashtax','Chaîne Gaming dédiée aux jeux mobile - sur Clash Royale et Brawl Stars principalement !\n\nMes réseaux sociaux :\n➤ Twitter : https://twitter.com/AshtaxYT\n➤ Instagram : https://www.instagram.com/ashtaxoff/\n➤ Discord : https://discord.gg/ashtax\n\n----------------------------------\n\nDébut de la chaine ✔ 10/01/2016\n100 abonnés ✔ 23/02/2016\n1,000 abonnés ✔ 22/04/2016\n10,000 abonnés ✔ 07/07/2016\n25,000 abonnés ✔ 17/10/2016\n50,000 abonnés ✔ 26/03/2017\n100,000 abonnés ✔ 19/07/2018\n250,000 abonnés ✔ 16/08/2019\n\n100,000 vues ✔ 13/05/2016\n1,000,000 vues ✔ 29/09/2016\n2,500,000 vues  ✔ 22/02/2017\n5,000,000 vues ✔ 09/06