, and have toured worldwide. They have collaborated with several vocalists outside of their band, including Shiina Ringo, Akira Kobayashi, Kyōko Koizumi, Schadaraparr, PUFFY, Yoshie Nakano and Tamio Okuda. They also performed the Japanese theme song to the PlayStation 2 game Sly Cooper and the Thievius Raccoonus, entitled \"Black Jack\", as well as songs for the PlayStation game Incredible Crisis released in 1999 and the 2020 television series Kamen Rider Saber.','2013-10-10T06:06:47Z',1830),('UC2GuoutVyegg6PUK88lLpjw','兄者弟者','★最新投稿情報はツイッターで！《@Otojya》https://twitter.com/otojya \n\n▼2BRO.関連チャンネルリスト\n【兄者弟者チャンネル】\nhttps://www.youtube.com/user/norunine \n\n【兄者のゲーム事務所】\nhttps://www.youtube.com/c/anijyagame\n\n【おついち Tube】\nhttps://www.youtube.com/user/afuramazda0826 \n\nWelcome to 2BRO. Official YouTube Channel!!\n弟者と兄者のエンターテイメントチャンネルへようこそ！\n\nTo Game publisher!\nWe never ask Steam Key by e-mail. So please don\'t send it. Thank you.','2010-05-05T06:48:07Z',2900000),('UC2h3_7-6Kp4-yT6e64PITOw','Ryo Sensei TV','Naruto Vie !','2016-07-02T15:34:20Z',359000),('UC2iLEQOjbk4CJszj34NtqHg','Лига Смеха','','2014-12-10T09:35:05Z',1470000),('UC2j4lymo8Ce_1RXMeo4afcQ','StylishNoob','','2015-04-04T21:23:20Z',330000),('UC2KS4qRIjsac_9uRlSmqWmA','ジンさん Ginthree','BLEACHの考察や解説動画を投稿しています！\n意外と知らない設定や知識もお届けしているので、BLEACHファンの皆様はぜひ！\n\n《著作権について》\nチャンネル内における動画にて使用、掲載している画像や動画、台詞などの著作権・肖像権等は、各権利所有者様に帰属致します。\n動画の内容については、各権利所有者様や第三者に不利益のないよう、細心の注意を払って制作しておりますが、万が一動画の内容に問題がある場合、各権利所有者様本人からご指摘いただけますと幸いです。\n\n動画に関しては以下の方及びガイドラインを遵守しております。\n文化庁\nhttp://chosakuken.bunka.go.jp/naruhodo/index.html\nYouTube ガイドライン\nhttps://www.youtube.com/intl/ja/about/policies/#community-guidelines\n\n参考資料＆引用\n久保帯人/成田良悟/松原真琴/集英社/BLEACH/アニプレックス/テレビ東京/電通/studioぴえろ/\n※動画内で使用している作品は全て上記作品からの\n引用になります。\n\n《権利者様へ》\n上記を遵守し、ご迷惑掛からないよう細心の注意を払いながら動画を投稿させていただいております。\n当然、権利は権利者様へ帰属いたします。\n大変身勝手な都合ではございますが、YouTube様へ直接権利申請がされた場合、本チャンネル全てが削除されてしまう可能性がございます。ご迷惑が掛かっていた場合、違反箇所のご指摘を以下のアドレスにご連絡頂き、出来れば順守した範囲内で動画投稿が続けれられば幸いであると考えております。\n作品にご迷惑