.com/Criisalys \nhttps://instagram.com/curisaris \nhttp://crisalys.tumblr.com','2018-08-16T15:58:03Z',912000),('UC7f7rUZwpNoZ3_T9UqH5gwA','Yassine BLJ','','2019-08-14T21:07:45Z',154000),('UC7h1p9Ya_ECneI1kOHHZD8w','ysp yokohamatotsuka channel','YSP横浜戸塚チャンネルは、ヤマハの正規ディーラーとして主にヤマハのバイクに関する情報を提供しております。\n\n「YSPとはなんですか！？」っとよく聞かれるのですが、YSPとは「YAMAHA SPORTS PLAZA」の略となり、40年の歴史を持つヤマハスポーツバイクの正規ディーラーの事を言います。ネットで出てくる有名社長のアレとは違いますよ！（笑）\n\nYOUTUBEに関しては、2014年から継続して投稿を続けています。やり始めた切欠は、少しでも当店で購入して頂いたお客様に向けて、バイクの操作方法等に不便がないように、また納車後の遊び方の提案などになればと始めたものです。\n\n今はですが、有り難い事にたくさんの全国の視聴者様に支えられて、楽しみながらチャンネルを成長させる事が出来ました。今後は少しでも二輪業界の発展と、またバイクの遊び方・素晴らしさを伝える事で、ライダーが少しでも増えて盛り上がればと真剣に思っております。\n\n2019年からは、車両だけではなく、二輪パーツや用品、キャンプグッツやイベントなど、出来る事はタイアップしていき、色々な情報を視聴者様に伝える事が出来ればと考えております。\n\nYSP横浜戸塚チャンネルへのお仕事のご依頼やご相談は、下記のリンクまたはメールアドレスから、お気軽にお問合せ下さい！\ntieup2015@gmail.com\n\nこんなパーツを取り付けて欲しい！こんな商品を紹介してほしい！といったPR(タイアップ)動画やパーツ・用品・商品レビューのご依頼も随時受付けておりますので、お気軽にお問合せ下さい。\n\nホームページはコチラです！\nhttp://www.ysp-yokohamatotsuka.com/\n\nプレゼントキャンペーン特設サイト▼\nhttps://yspyokohama-campaign.themedia.jp/\n\nPR(タイアップ)動画やパーツ・用品・商品レビューのご依頼はコチラです！\nhttp://www.ysp-yokohamatotsuka.com/tieup/','2013-10-23T06:17:11Z',87100),('UC7I3QTra4_kC4TSu8f7rHkA','マコなり社長','明日から仕事・人生に役立つ話を出来る限り、分かりやすく短く配信していきます！\n\nこれから「もっと活躍したい！」「成長したい！」と思っているビジネスマン・学生の方に特におすすめです。\n\n本業は社員500名規模のテクノロジー教育の社長です。\n\n22歳で起業してこれまで成功ばかりではありませんでした。\n事業は撤退、借金を背負い、仲間もみんな辞めたこともあります。\n\nでも、失敗した分だけ、人一倍多くのことを学ぶことができました。\n\n現在は、未経験からエンジニアになる日本一のスクールを運営しています。\n年商は数十億円規模。前年比、200%以上の成長をしています。\n\n私の望みは一つ「幸せに生きる人が増えること」です。そういった機会をつくることが私にとっては何よりも幸せで楽しいことです。\n\n私の経験・知見を多くの人に還元したいと思いYouTubeをはじめました。\nこれまで知らなかったやり方・考え方を知ることで、成功体験を得ていただきたいと思っています。\n\nもちろん私も完全な人間ではありません。\nみなさんと一緒に学びあい、成長していけるとうれしいです。\n\n\n■【実績No.1/日本最大級】テックキャンプ エンジニア転職\nhttps://tech-camp.in/expert \n↑完全オンラインで挫折せず学べます\n\n【マコなり社長のプロフィール】\n■本名\n真子就有(まこゆきなり)\n\n■生年月日\n1989/9/18\n\n■所属\n株式会社div 代表取締役/ Founder\n\n■趣味\nバスケ/ランニング/アニメ/映画\n\n■会社のコーポレートサイト\nhttps://di-v.co.jp/\n\n\n■YouTubeビジネス関係のお問い合わせ（企業案件・コラボ等）\nhttps://forms.gle/YWXVuj9K