51Z',189000),('UCcmBUG56igRMAK1mVPbOuaw','Etienne, agri youtubeurre','Agriculteur dans la Sarthe, éleveur de vaches laitières. impliqué dans la défense de mon métier et de l\'agriculture et l\'élevage français en règle général. \nPour le bien être animal, et les bonnes pratiques d\'élevage et c\'est mieux quand on le dit et le fait ;)\nJe partage mon quotidien, pas toujours facile mais toujours avec passion. \nBon visionnage a tous !! :)','2012-04-11T10:51:12Z',59300),('UCCMUnWvJyTEUunnygpTGfow','Araathi','Araathi is a Hyperactive Tamil girl, presenting you the funny sketch videos.\n\nPlease do subscribe to Araathi to get more video updates.\n\nFor business enquiries, email us at brands@tamadamedia.com','2019-07-02T16:05:26Z',1450000),('UCCMxHHciWRBBouzk-PGzmtQ','Bazar du Grenier','La chaîne \"fourre tout\" du grenier ! \n- Cinéma\n- Jeux de rôles\n- Let\'s play\n- Reviews de jeux !','2014-08-19T11:22:28Z',1670000),('UCcOFa4pIpwbtSexXCM9RF1g','うまなみ競馬予想チャンネル','はじめまして、うまなみです。\nいつも観ていただいて本当にありがとうございます。\n【馬券に絡む馬】\nを超シンプルに見つける競馬予想動画を配信しています。\n\nシンプルに予想することこそ的中への最短ルートなのですが、これがなかなか難しいですよね。\n最近はネット上にたくさんの競馬予想データがあふれています。\n予想をすればするほど情報過多になり集めた情報を上手く整理することができず、\nいざレース直前の最終予想の時には「何のデータがどうだったっけ？…」\n結局レースが終わってみたら「あ、しまった！そうだった…」という経験ありませんか？\n私は散々その経験を、うんざりするほど失敗をしてきました。\n【みなさんに同じ轍は踏ませない‼】\nこれが私の、このチャンネルを運営する目的です。\n毎週行われる重賞レースの予想を配信していきます。\n最適化されたシンプル予想で、みなさんのお役に立てるような情報をお届けしていきます。\n\n平場レースの推奨馬や個人的な勝負レースなど、\n馬券に役立つ有益な情報を\nLINE＠にて配信させていただいております\nうまなみ公式LINEアカウント\n一番下のリンクより、よろしければぜひ友達登録をしてみてください。\nまたは　@umanami　で検索してください。\n\nまた、無料メルマガを配信開始させていただいております。\n無料メルマガは以下の予定で配信しています。\n毎週水曜18時配信+＠週末配信\n◎水曜日…競馬関連情報\n◎金曜日…無料予想（土曜平場の注目馬）\n◎土曜日…無料予想（日曜平場の注目馬）\n\n【週末の競馬予想に使える有益な情報】\nをお届けさせていただきます。\n・99%の人がおそらく知らない圧倒的な数字\n・1週間で競馬の価値観が変わる最強トレーニング\n・多くの人が間違えてる◯◯の買い方\n・損をしてしまう74%の法則\nなど、\n「これ知っておいてソンではないですよ！」\nという情報や、私が伝えたいことやりたいこと、\nメルマガならではの、YouTubeではお話できないことを素直に書かせていただいております。\n\n人生も競馬も負けないマインドを身に付ける無料メルマガ\n『うまなみ競馬予想チャンネルの動画では言えない話』\nこの機会にぜひ、一番下のリンクより、ご登録くださいませ。\n\nみなさんと一緒に、よりいっそう競馬を楽しんでいけたら幸せです。\nうまなみ','2020-05-01T03:56:20Z',0),('UCCotQ9x_MPdw3fwEpCxlbnQ','ClayClaim','Welcome to my world of clay creations! My name is Simon and I love to make polymer clay creations based on (mobile) games!\n\nInstagram ▸ https://www.instagram.com/clayclaim/\nTwitter ▸ https://twitter.com/ClayClaim\nOnline Shop ▸ https://clayclaim.com/\n\n\nEmail me for business related projects inquires: contact at clayclaim dot com','2015-07-24T10:25:19Z',2510000),('UCCO_itOx-wopeBohj5oPkzg','ひまひまチャンネル','UUUM専属クリエイター☆\nhttps://www.uuum.jp/creator/\n\nひまひまグッズ絶賛販売中！\nhttps://muuu.com/videos/5569e3200c31c43d\n\n2016年6月ひまひまチャンネルスタート♪\n主に女子中学生ひまひまの興味のあることやかわいいもの・お出かけや買い物、購入品紹介などを明るく楽しくおもしろいと思ってもらえる動画をアップします♪\n動画は基本的に毎日投稿（平日は16時、土日祝は朝8時公開）しています。\n\nメインチャンネルの他「ピカいち CHANNEL」で俳優の鈴木福くんとツインMCもやってます。\nhttps://www.youtube.com/channel/UCCV3RigKiLxFOqlYZcsq35w\n\nお手紙やプレゼントなどは、下記のUUUM事務所までお願いします☆\n*******************\n〒107-6228\n東京都港区赤坂9-7-1\nミッドタウン・タワー 28階\nUUUM株式会社\nひまひまチャンネル宛\n*******************\n\nその他、メディア出演、お仕事等に関するお問い合わせは、\nUUUMまでお願いします。\nhttp://www.uuum.co.jp/inquiry_promotion\n\nアカウント管理、コメント管理等YouTubeチャンネルに関する管理一式は父がしています。\n\nHimaHima Channel\nPlease Subscribe! :-)\n\n- Tik Tok -\nhttps://t.tiktok.com/i18n/share/user/6568082631731200002/\n\n- Instagram -\nhttps://www.instagram.com/himahima_channel/\n\n- Twitter -\nhttps://twitter.com/himahima_chan','2012-09-05T06:48:21Z',328000),('UCCqjcd5OLpNibOGfHhNl3Yw','mimi neko','みなさん、こんにちは！miminekoです??\nいつもご視聴、高評価、チャンネル登録ありがとうございます！\n\n私達は誰もが最高傑作で生まれてきたから、ありのままの自分が一番美しい✨✨\n『最高傑作の自分に戻ること、自分を愛すること』\nを、メインテーマに、カードリーディングを展開しています。\n\n❤️miminekoのお守りアクセサリー＆パワーストーン天然石のonline shop???\n『ANGELICA』\nhttps://angelica.nekonekoland.com/\n\n?スピリチュアルお喋りサブチャンネル\n→ https://www.youtube.com/channel/UCiSBGkBwLny-N_rTtFNxYLA\n?Twitterフォローしてね！\n→https://twitter.com/mimineko_0406\n?Instagramフォローしてね！\n→https://www.instagram.com/mimineko_neko\n\n\n?個人鑑定について\nmiminekoは個人鑑定はしておりません。\nリクエストリーディングはいつでも受け付けていますので（全て採用できるわけではありません）\nコメント欄にぜひリクエストして下さい?\nまた、簡潔にタイトルでリクエストしていただくと嬉しいです！\n\n?mimi n