نفس\" لكي تشرح سبب ضرب زوجها لها لابنها، محاولة إقناعه بأنها مجرد لعبة. لقد توفي أخو \"نفس\" والذي كان قريبها الوحيد أثناء محاولته إنقاذها. مصطفى، رجل أعمال من منطقة البحر الأسود، يأتي إلى اسطنبول من أجل عقد اتفاقات جديدة مع وداد، ويقوم بإحضار عائلته معه. يقيم مصطفى وعائلته في منزل وداد ويلاحظ \"طاهر\" أخ مصطفى أن \"نفس\" قد تعرضت لعنف منزلي. وللأسف لا يستطيع \"طاهر\" القيام بأي شيء لمساعدة \"نفس\" ولكن \"نفس\" تقوم بوضع خطة جديدة للهروب في ذلك المساء وتختبأ في شاحنة \"طاهر\" مع ابنها. خطتها هي الخروج من تلك الشاحنة بعد مغادرتها للمنزل وبدء حياة جديدة مع ابنها. ولكن الأمور لاتجري وفقا للخخطة، يغلب النعاس \"نفس\" وابنها في مؤخرة الشاحنة. وعند استيقاظهم يجدون أنفسهم في \"طرابزون\" على البحر الأسود. يكتشف \"طاهر\" هذان الشخصان في طرابزون وليس لديه أدنى.....','2019-12-27T08:51:32Z',609000),('UCEnkd5D-53MDGpgpiQRbUqw','よしなま','24歳です。\nゲームが大好きです。\n\n↓何かありましたらこちらまでお願いします。\nyosi_9801@outlook.jp','2014-06-01T16:12:04Z',701000),('UCENoC6MLc4pL-vehJyzSWmg','もこうの実況','動画を見てくれ！以上\n\nmokou.work◯gmail.com','2014-01-07T14:36:33Z',1100000),('UCEogoSmoWxlmGs2UyIgLjgw','ゆうこる/Yuukoru','サブチャンネル\nhttps://www.youtube.com/channel/UCqUPmQTcmWREuoG9or5TRCQ\n\nTwitter @yuukoru_\n\n\nパズドラオタクです','2017-06-06T12:37:00Z',188000),('UCeQFvZ26vng-kXkHZu2wjQw','猫のレモンちゃんねる//Cat Lemon ch','?2019/05/17日\n? Scottish Fold♂\n?Japan','2019-05-10T10:21:25Z',101000),('UCEqQlGbiuheoBwYCC4VV4tA','めるぷち','「めるぷち」は、小・中学生の等身大のカワイイをお届けするYouTubeチャンネル！\n毎週金曜17:00投稿！\n\nカワイイを毎日アップデートし続ける「MelTV」の妹チャンネルとしてスタートしました！\n\nこのチャンネルの主人公は、みんなと同じ小・中学生の女の子たち。まだまだ未熟な彼女たちだけど、カワイくなりたい気持ちは一人前！\n\nそんな彼女たちが「YouTube」を通じて、\nあなたもきっと気にいる等身大のカワイイを調査していきます！\n\n恋に部活に勉強に、大忙しの高校生になる前に、\nカワイイ女の子になるためのスタートダッシュを決めちゃおう！\n\n「さぁ、カワイイをスタートしよう！」\n「さぁ、カワイイにチャレンジしよう！」\n「さぁ、カワイイをインストールしよう！」','2019-04-17T04:32:24Z',248000),('UCeqsLJGWhZXEerY5JWvwLkg','Le Monde à L\'Envers','Hey salut ! Nous, c\'est Jenny & Valentin. \n\nOn réalise des parodies, des sketchs et même une web série, tout cela pour ton unique bonheur jeune être humain :D\n\nPourquoi Le Monde à L\'En