動画にしています。\n\n一息つきたい時、疲れた時などに、癒され・楽しめる動画を目指して、作っています。\n経験談は、一般論ではなく、経験に基づいた視点から話をするようにしています。\n\nコメントがあれば、お気軽に投稿してくださいませ。\n\n共感したり、面白いなと感じたらチャンネル登録もお願いします。\n\n●コメントしずらい相談などがあれば、ツイッターかインスタでメッセージ頂ければ、できる範囲で回答させていただきます。\nツイッター：https://twitter.com/yachannel99\nインスタ：yachannel99　で検索すると出てきます\n\n（ツイッターは、たまにつぶやく程度で、インスタは、ほとんど投稿していませんが、メッセージは毎日見ています。）\n\n●コラボやビジネスに関係するご連絡は下記までお願いします。\n（現在、多忙のため、コラボはお断りしています。また、自分らしい動画を作るのがモットーなので、そこから外れるようなご提案はお受けできませんので、ご了承お願いします。）\ndiet.yasuharu@gmail.com\n\n生きにくい世の中ですが、一緒に頑張っていきましょう！','2020-03-10T22:34:26Z',143000),('UCgvqvBoSHB1ctlyyhoHrGwQ','Amixem','Voyages, Expériences, Découvertes, Humour (des fois), LeBonCoin (Souvent), Amazon (Souvent aussi) et plein d\'autres vidéos qui rendent ma chaîne tellement indescriptible que du coup j\'arrive pas à finir cette phrase. \nMAIL PRO / BUSINESS INQUIRIES : contact@amixem.com','2012-11-09T15:29:18Z',6620000),('UCgWfS_47YPVbKx5EK4FLm4A','Jenn Im','Business Inquiries: jenn@rare.global\n\nI\'m Jenn Im. Korean American. Born and raised in LA. Clothes Encounters is a vlog of style musings, tutorials and lifestyle advice.','2010-03-01T05:15:41Z',2790000),('UCgWMXFq6DWRx6I3yfdrvrlQ','L\'argus','Les vidéos de L\'argus.fr sont vraiment différentes, décalées et parfois insolites. Toute la rédaction se met en situation pour vous présenter les dernières nouveautés automobiles. Renault, Peugeot, Audi, BMW, Mercedes-Benz, Ferrari, Tesla... il y en a vraiment pour tous les goûts. Alors abonnez-vous !','2014-03-27T14:35:51Z',70800),('UCgwNAGfFi6SLkqF0nJnUv9A','京口紘人 Hiroto Kyoguchi【WBA世界王者】','第23代IBF世界ミニマム級王者V2\n現WBA世界ライトフライ級スーパー王者V2\nリングマガジンライトフライ級王者\n日本最速世界王座獲得 デビュー１年３ヶ月','2019-10-01T01:14:07Z',131000),('UCGWoTWsXJi1UtCjOiBHIsfw','Sofyan','Maître de la vidéo, Roi du doublage et Seigneur des sondages.','2012-05-31T11:03:06Z',1600000),('UCGX0i593ciGvM-6hY3yg0Dg','【魔法使いの学校】吉岡純子','このチャンネルでは、\n眼に見えない力を使って現実を創っていく\n引き寄せの法則・量子力学・宇宙理論などの\nお話をしています。\n\n【魔法使いの学校】と名付けている理由は、\n単に”降ってきちゃった”からですが、笑\n”目に見えない力で現実をクリエイションする宇宙理論て\nまるで魔法使いみたいだな～”と常々感じていたので\nチャンネル名として採用してみました^^\n\nご興味がある方は、\nチャンネル登録よろしくお願いします^^\n\n\n\n☆吉岡純子　プロフィール☆\n\n\n数年前までニートでした。笑\n健康、お金、恋愛と、全てにおいて枯渇していて\n本当に苦しかったです。苦笑\n\nしかし貯金が底をつき\n借金をしながら起業したところ\n起業初年度の売上は3000万円。\n\n次の年には売上は億を超え\nその後もずっと年商.年収は右肩上がりです。\n(検証してみたところ大体4.5倍以上のペースで増えてます〜。)\n\n\nそして「令和の元日」に愛する彼と結婚もして\n今は本当に幸せです^ ^\n\n\n↑の様に、人生が大逆転してしまったのは\n宇宙の法則(自分の波動.感情.振動数で現実を創るという法則)や宇宙存在が大好きだった為、\nそれらの知識を駆使して生きてみたからだと確信しています。(もちろん地球的に必要な行動はしている事が前提ですが☆)\n\n\nだからこそ、、、\n\nどなたかのお役に立つのであれば\n宇宙理論をシェアしたいな〜と感じる様になり\n自由気ままに情報発信をしています^ ^\n\n\nーーーーーーーーーー\n\n\n個人起業をしてからは\n\"順風満帆\"\"羨ましい\"とよく言われますが\n起業する前の人生は結構大変でした。\n\n\n自身が小学3年生で見知らぬ男性から性的暴行を受け、その後摂食障害、うつを経験。\n20歳前後で精神科での入退院を繰り返しています。\n\n\nそして20代半ば過ぎで\n45m車に引きづられる交通事故、\n数年後に心臓病を発症。\n\"余命一週間\"とされ死にかけたものの謎に生きのびましたが、その後は高級アザラシ(世の中ではニートと呼びます。笑)として数年生きました。\n\n\nもうこんな不幸な人生が嫌で嫌で、\nなんとか幸せになりたくて、\n\n宇宙理論、引き寄せの法則、心理学、量子力学、スピリチュアル、医学等々の本を読み漁り、、、\n一念発起、個人起業。\n\n現在は経営者として様々なビジネスを展開しています。','2018-07-25T03:19:01Z',86200),('UCgX66nFZQodWgTeNIMF_4Rw','LondonGrammarVEVO','A trio from London\n\nSUBSCRIBE for more videos from London Grammar.\n\nCONNECT with London Grammar:\nhttp://londongrammar.com\nhttp://facebook.com/londongrammar\nhttp://twitter.com/londongrammar\nhttp://instagram.com/londongrammar\nhttp://soundcloud.com/londongrammar','2013-05-29T00:28:10Z',98200),('UCgXIDZzs8ksN7k9pl3K-50Q','GQ France','Style, sport, voitures, musique, food, culture, sorties, lifestyle... Chaque jour, retrouvez sur GQ tout ce qu\'un homme doit savoir pour briller en toutes circonstances. Ce qu\'il faut avoir lu avant d\'être vu.','2010-02-12T13:04:48Z',297000),('UCgXvaaXlru9tCg4bA9lZcLg','Edward Sad','Hey Guys ! Retrouvez moi chaque dimanche pour une nouvelle vidéo ou j\'vous partage ma vie seul ou en famille !\ncontact pro: Thedwardsad@gmail.com','2015-08-17T16:29:01Z',481000),('UCgXyMl3Y2kRHkK08F_Ct8Pg','はじめしゃちょー2 (hajime)','こんにちわ!!はじめしゃちょーです!!\r\nこちらのチャンネルではゲーム実況動画や本チャンネルでは出さないようなくだらない動画を出していきます(#^.^#)','2012-10-25T16:10:41Z',2560000),('UCgy1mxPcdm6d-NvUfmYrDWw',