wkDwT1o5EFw','プレミアリーグ・トークショー','★スポーツの情熱と感動を届けて日本を元気にする★\n初めて東京の満員電車に乗って衝撃を受けました…みんな目が死んでいる。\nオーストラリア育ちですが東京生まれの自分に何か出来ないかと考えました。\n\n自分はスポーツ、特にリバプールから多大な感動、情熱、パワーと笑顔を貰っています。\nスポーツの魅力を届け日本を元気にしたい！そんな想いでチャンネルを運営しています。\n\n★目指すチャンネル像★\nサッカー知識がなくても楽しめ元気がでる、それと同時にちょいちょい知識も勉強できる。\nそんな欧州サッカーの魅力をお届けるチャンネルを目指してます！\n\n★About Us★\nケニー（管理人）：リバプール一筋18年、東京生まれオーストラリア育ち、ロンドンとサンフランシスコ経由して今は東京にいます。子育てと動画編集に埋もれる毎日を送ってます。\nトモ：キャンプとサウナ大好き。ちょいちょいゴルフの話題にも熱がこもります。\n\nケニーのツイッター（リバプールツイートばっかです）：https://twitter.com/lfc_passion\n\nお仕事の依頼はこちらにDM下さい！https://twitter.com/lfc_passion','2019-11-27T04:04:33Z',59300),('UCJwZxUqMS6wg3mhYUUU6KJg','オジサンの休日','','2019-03-05T12:22:09Z',131000),('UCjxnv4cOYHI-DSI61i7nniQ','YoMax','Yoooooooooo la famille !\n\nMoi c’est YoMax, Youtuber & Streamer de 26 ans, à travers cette chaîne je te\nfais découvrir mon univers qui se divise en 3 parties :\n\n◽️ FIFA avec du Pack Opening, des World Record Draft, FUT Champions et\nd’autres concepts\n\n◽️ Le Foot avec des concepts fun que je fais principalement avec mes frères\nIdriz et Faïz\n\n◽️ Les vidéos délires avec la Team IFY et d’autres potes !','2009-12-30T22:39:02Z',1080000),('UCJy0lX8ThZ7lCtst7JnegWQ','Jojol','Jeune homme de 28 ans et passionné par l\'high-tech, je me suis lancé sur Youtube en 2010 pour partager ma passion. Aujourd\'hui vous êtes plus de 2 millions de JOLOWERS sur la chaîne Youtube , un gros GROS MERCI!!! :) N\'hésitez pas à vous abonner pour rentrer dans la famille des JOLOWERS  ❤ \n\nJe suis aussi sur Facebook, Twitter, Instagram et Tiktok, donc si vous êtes sur ces réseaux sociaux, n\'oubliez pas de m\'y suivre. Je partage des informations que je ne donne pas forcément sur Youtube ;)\n\nJ\'essaye de faire au minimum 2 vidéos par semaine : le mercredi et samedi vers 17h00 :D','2009-04-10T11:13:56Z',2010000),('UCJyGoLz_sLHHHI1uEPg6UhA','仲里依紗です。','','2020-03-17T09:45:18Z',709000),('UCJY_S7-OCeTcQ1oYpKalJ9Q','♥MayHills♥','モータースポーツの世界に憧れ、数年貯金をし、この世界へ飛び込む。練習に集中する為、仕事を辞め貯金が尽きるまでに芽が出なければ諦めると決めていた。\n南千葉サーキットで毎月開催されている、ドライビングスクール車楽人アソシエーションに入校し、現師匠(スクール代表/元D1ドライバー佐藤謙)に出会う。\nはじめは全く相手にされなかった。どうせ本気なんて口だけで、すぐ辞めると思われてたようだ。本気で上手くなりたくて気付いたら、南千葉サーキットに1年間で160日以上通いつめていた。のちに師匠が練習メニューを与えてくれるようになり、毎回練習の結果を動画で報告し100点が出るまで、必死になって練習していた。「そこまで本気なら俺も本気で教える」と持っている技術を惜しみなく伝授してもらえるようになり、次第にトヨタのドライビング講師や、その他イベント講師の依頼が舞い込んでくるまでに成長する。日本の地上波TVにも多数出演、有名俳優などの講師も勤めるようになり、モータースポーツの世界で生きていく夢が少しずつ現実に。\n\n車楽人で教わる事は、そのコースでしか通用しないコースの攻略法じゃなく、車をコントロールするための基礎を学ぶ事が出来る。トップカテゴリを見て目が超えるようになってから、当たり前に教わっている事の、レベルの高さに気付く。車楽人は30周年、3,000人程の会員数がいる。そして来る人のほとんどがリピーター。どんなにすごいスクールなんだと口で言っても説得力がない。下田紗弥加を育ててくれた師匠と車楽人へ恩返しをしたい思いでそれを証明するべく、モータースポーツを始めて2年でD1Aライセンス(D1Lightsの出場権/ドリフト競技の全日本戦)を取得し今現在、車楽人代表として世界最高峰トップカテゴリ『D1GP』の権利を取得する為にD1Lightsシリーズ戦で戦っている。\n\nついこの間まで、モータースポーツに縁もゆかりも無かった、素人の女子が夢にまで見ていた世界で生きて行く事ができたら...世間の人たちへ勇気や元気を与えられる人になりたい。という思いが詰まったチャンネルです。果敢に挑戦し、仲間たちと真剣に笑って泣いて、時にはつまづきながら、夢を現実に変えていくストーリーを、どうぞご覧下さい。','2015-01-04T13:57:32Z',35500),('UCJznkSHH17Z-MkE0gmZeuTg','ちゃんけブログ','こんにちわちゃんけです\nこのチャンネルはちゃんけが\n仕事 トラック 遊び お酒 飯テロ 雑談 \nなど、まあまあ適当に撮って適当に\n視聴していただくチャンネルでございます。\n2日に一回適当に更新します！\nたまに、ライブも、します！\nよろしくお願いします?\n\nTwitter\nhttps://mobile.twitter.com/chankblog\n\n仕事依頼 その他ご連絡はこちら\nchanke2222@gmail.com','2013-04-20T06:25:57Z',50000),('UCJZVj2iBrdvbNc416i0V-UA','朝倉未来 Mikuru Asakura','','2018-05-13T13:16:32Z',1560000),('UCj_ARBxhCoF5JxUItcEUs7Q','DailyDrivenExotics','Daily Driven Exotics is a Entertainment Group, founded in 2012 by Canadian entrepreneur Damon Fryer, with its headquarters located in Western Canada. Fryer\'s vision was to create an aspirational lifestyle brand that combined exotic automobiles, action sports and popular culture. \n\nWe look forward to sharing our adventures with you and together creating a united Supercar community that doesn\'t just tuck these amazing machines away in garages but rather takes them to the ends of the earth for all to enjoy!\n\nFANMAIL:\n\nDaily Driven Exotics\nSuite 400, 119-14 St NW\nCalgary, AB T2N 1Z6\n\nThank you!\n\nFollow us on:\nhttps://www.instagram.com/dailydrivenexoti