oQ8lN5Bb008C7pKg8g','REEKO Unchained','Je suis Eric PHILIPPE et REEKO Unchained est ma chaîne perso. Elle est officiellement née dans un contexte difficile, la pandémie de COVID-19 de 2020, mais elle me trottait dans la tête depuis 2018. Je n’avais alors aucune intention de quitter Motorlive dont j’étais rédacteur en chef mais j’avais de plus en plus envie de partager ma vision de ce qui nous permet de nous évader, au quotidien ou plus exceptionnellement : de la moto à l’automobile en passant par les scooters, les véhicules électriques, les drones, les jeux vidéos, le matos photo et vidéo... En bref, tout ce qui m’offre la sensation de surfer la planète, de rencontrer mes congénères par delà les frontières, d’autres cultures, d’autres façons d\'appréhender le monde qui nous entoure et où j’ai conscience de ne faire qu’un bref passage. Voilà ce que j’ai envie de partager avec vous. Au delà des objets, des produits, et même de passion : il est question de fraternité, de partage et, par dessus tout, de liberté.','2018-04-10T06:03:25Z',25200),('UClyvSlm-AkWi-OyuUZ9p6Rg','ハイサイ探偵団の休日','ハイサイ探偵団とは\n・○○を調査してほしい\n・○○を検証してほしい\n・○○に挑戦してほしい\n\n沖縄で釣り、料理、観光動画を投稿してます。\n依頼のメール、コメントをもらい、実行して動画にする団体\n仕事、動画製作、行っております→haisai.tantedan@outlook.jp\nツイッター→https://twitter.com/hittyaso','2016-08-11T08:24:31Z',324000),('UCLz6B7LxOdwgHbcgFi_hpQQ','Iro Sef','Salutations explorateur d\'univers ! Moi c\'est Iro et mon truc, c\'est de parler de théories, d\'analyses et de rétrospectives d’œuvres, que ce soit de films, de jeux-vidéo ou encore de séries. Ambiance poétique et infernale, pour le grand plaisir des plus curieux d\'entre vous. J\'ai découvert de multiples univers depuis mon plus jeune âge et je me plais à les explorer en votre compagnie. A travers mes vidéos je souhaite partager mes idées, explorer de nouveaux horizons et surtout vous faire découvrir ma passion.\n\nIro Sef, l\'explorateur d\'univers.\n\nContact : sefiroxshow@gmail.com','2012-03-14T16:15:16Z',226000),('UClZF7OsrECe3t_ADrjZ