es semaines, retrouvez trois nouveaux épisodes de séries !','2015-08-18T08:14:46Z',114000),('UCQkxTH2OYLJDWnLdCSrEdRg','我輩はポンである!','This is the shelter I made for stray cats. I have been reforming the shelter to make it more comfortable for them. There are people in my vicinity who only feed homeless cats without castration. This, however, ends up in the increased number of unfortunate stray cats, which causes a number of problems. Many cats are injured and killed in traffic accidents. Some people who do not like cats abuse and even kill them. My activity is to rescue stray cats, castrate them and find foster parents for these cats. I also hope that these posted videos provide an opportunity for you to think about how to help homeless cats. \n\nこれは野良猫のために私が作った猫の保護シェルターです。猫にとって住みやすいようにシェルターをリフォームしてきました。私の近くでは去勢をせず餌だけ与えている人たちがいます。しかし、それは不幸な野良猫を増やす結果になり、多くの問題を生じます。交通事故で怪我したり死んだり、中には野良猫を虐待、殺害する人もいます。私の活動は野良猫を保護し、去勢をし、里親を探すことです。そして、これらの動画がみなさんに野良猫をどう助けたらよいかを考える機会になることを望んでいます。','2013-09-24T13:38:49Z',45800),('UCQKzkqirhKvpa7DxzG55ZIw','ペカる☆TV パチンコパチスロ実践バラエティ','パチンコ・パチスロ実践エンターテイメントバラエティ「ペカる☆TV」\n日本屈指の養分ゆうちゃろが、毎回自腹でリアルな実践動画をお届け！\n負け「キャラ」ではなくリアルに負けているんで、ガチ解説とか無理です無理なんですごめんなさい、もっ、物を投げないでっ！！\n\n\n\n\n\n------------------------ゆうちゃろプロフィール------------------------\n日本屈指のガチ養分ゆうちゃろ。4号機時代にプロを名乗るも、実際は仕送りで生活していただけで、収支は常に年間マイナス。\nパチンコから足を洗おうと正社員になるも、麻雀中に金玉の左右が入れ替わるという奇跡の体験をし、強制長期入院からの一発解雇。\nそれからネット販売の服屋を始めるも、無名に等しいので倒産寸前。\n\n服屋の僅かな売り上げを握ってパチンコ動画配信を始めるも、ギャラはないので勝たないと配信すればするほど赤字の蟻地獄（白目）\nそろそろ三途の川が見えてきたっ...！\n\n【知識】赤くなれば大体当たるよね？\n【レベル】マイナス1万までなら勝ちに入れてよし\n【口癖】さぁ、さぁー、これ確定？\n【特徴】たらこ唇\n【酒癖】人格が変わる\n\n\nゆうちゃろツイッター https://twitter.com/yu_tyaro','2015-07-29T05:37:20Z',217000),('UCqLFD7L0m1FxSflPpB1Lzug','Joony Cashh','Je partage avec toi les motos que je retape, amateur de gros 2 temps, j\'espère que tu l\'es aussi ! \nEt également la vision que j\'ai du motocross, passionné mais pratiquant loisir avant tout ! \nEt qu\'après avoir survécu à un des pires cancer, la vie continue d\'être belle !','2