ぞよろしくお願いします。\n\nThank you for visiting Pastel Cat World channel. We have 2 cats, Neko-kichi, romping princess cat, and Boss-kichi, actually ex-leader cat of the stray cats\' troop. In this channel, we upload well edited their videos in several categories, such as vlog, walking, cat toys DIY, and unboxing & reviewing cat products.In addition, our latest videos are only available on the official website, so please visit there!\n☆Please contact me via email in Japanese. I cannot reply to your email if it\'s written in English or other languages. \nSorry for the inconvenience.','2013-07-29T14:08:39Z',264000),('UCR-fgueb8Ufzrl0qNXCwcdg','Romy Victory','Vintage, Hollywood , Stéphane Bern, glamour, perles, Booba et vinyle de Lana Del Rey.\n\n\nVous pouvez me suivre ici !\n\n❤ Twitter : http://twitter.com/romyvictory\n❤ Instagram : http://instagram.com/romyvictory\n❤ Facebook : romyvictory\n❤ Snapchat : romaneleilat\n❤ TikTok : @rendezmoimonnom\n\nContact (pro seulement) : romyvictory@gmail.com','2017-01-19T19:28:38Z',834000),('UCR-mlJLhLca9jVu94I9qpmg','مع حسين','قناة مع حسين\nاهلا بكم فى قناة الاعلامي الحر حسين بديني \nأهم و آخر الاخبار و المستجدات حول العالم نقدمها لكم بشكل احترافي وتحليل موضوعي و اسلوب بسيط\nانتظرونا','2019-09-12T19:30:09Z',0),('UCR0AmTfT-VPEHEZq1cnumCg','Kei Gekiku','Keigekku YURURI 軽撃区　ゆるり　\n\n日本の野球、アメリカンフットボール、ゴルフ　日本の食文化をビデオにしました。\nすべて現地映像のオリジナル動画です。\n特に日本のゴルフヘッド製作の卓越した鍛造技術。それを紹介したくビデオにしました。　\nWelcome to Keigekiku YURURI page.\nWe introduce Japanese Precise Forging and Japanese baseball, Japanese American Football, Golf and Japanese  food.  \nPlease enjoy the Movie.   \nhttp://www.golfmall.co.jp/','2012-01-18T09:43:24Z',29800),('UCR0V48DJyWbwEAdxLL5FjxA','日向坂46 OFFICIAL YouTube CHANNEL','秋元康　総合プロデュース。けやき坂46から日向坂46へ改名。2019年3月27日1stシングル「キュン」をリリース！','2019-02-28T06:05:07Z',519000),('UCr17WjWGQLduK6D6QL0Ha7w','たぬぐっチャンネル / Atsushi Taniguchi','谷口敦史／Atsushi Taniguchi\n整備士＆チューナーとして２０年以上、ドリフト歴１０年以上のキャリアをあわせ持ち愛知県を拠点に日本のみならず海外でも得意分野を活かして車を通じた仲間と「車で遊ぶ」をモットーに楽しみながらYouTube活動をしております！\nD1GPライセンス＆JAF国内A級ライセンス保有\nドリフトインストラクターとしてアメリカ、マレーシア、インドネシア、タイ、モンゴルなど世界各国に日本の「ドリフト」を教えに行ってます(^^)/\n2019年8月　NETFLIXの「HYPERDRIVE（ハイパードライブ）」という番組に日本代表として出演\nハイパードライブとは世界中から集められた凄腕ドライバーたちがクレイジーな障害物に挑むタイムアタックレース。Atsushi Taniguchiは日本の「DRIFT SENSEI」として日本を代表する車種「TOYOTA CROWN」のパトカー仕様をおよそ６００馬力までチューンして挑戦！\nぜひNETFLIXにてお楽しみください\n\nHi There! I\'m Atsushi Taniguchi. Call me \"DRIFT SENSEI\"\nEnjoy my YouTube channel!!','2015-02-07T11:48:52Z',54800),('UCr1fdFXztwacnJ206hMgG7w','Cas van de Pol','Cartoons n stuff!','2014-02-20T12:16:10Z',1400000),('UCR1vMiGggY5jSDL_eTkXJCA','Narukami Sabaki Official','Vtuber界で何か起きた時は御知らせ下さい。\nこちらからも聞き返せるDMか、もしくは匿名の場合はマシュマロで！','2018-10-14T20:22:45Z',91600),('UCR1zT1s524Hbc85bdvno_8w','Aimer Official YouTube Channel','Aimer Official YouTube Channel\nシンガーソングライター\"Aimer（エメ）\"によるOfficial YouTube Channelです。\n不定期でライブ映像やミュージックビデオをアップしていきます。','2013-02-07T11:35:47Z',1250000),('UCR1_4Tla5MlZlDK8WM5vklA','brother4 channel','YouTubeが大好きな仲良し４兄弟のbrother4 channelです(^^)/\n\n長男：いくま・次男：だいち・三男：あつき・四男：ななと\nこの4兄弟がおもちゃなどの商品紹介やドッキリ動画・日常動画をアップしています！\n\nWe are 4 good friend brothers who love YouTube!    \nEldest Ikuma, 2nd Daichi, 3rd Atsuki and youngest Nanato  \nWe hope you enjoy watching our channels! Don\'t forget to subscribe!\n\nお手紙なども是非お待ちしております(^_-)-☆\n〒107-6228\n東京都港区赤坂9-7-1\nミッドタウン・タワー 28階\nUUUM株式会社　brother4channel 宛','2015-01-12T04:31:55Z',384000),('UCr24Ll7IT2hPquu-n11dNWQ','暇72','暇72（ひまなつ）と申します。\n声真似ゲーマー歌い手マン。Buber所属。\n\n【Twitter】\nhttps://twitter.com/hima72_25\n\n【YouTube】\nhttps://www.youtube.com/hima72\nhttps://www.youtube.com/hima72-2nd \n\n【TikTok】\nhttps://www.tiktok.com/@hima7225\n\n【Instagram】\nhttps://www.instagram.com/hima7225/\n\n【グッズ販売】\nhttps://hima72.booth.pm/\n\n【お問い合わせ＆仕事依頼】\nbuber_info@blueoceanmedia.jp\n\n【ファンレターやプレゼントはこちらまで】\n〒 104-0032 東京都中央区八丁堀三丁目27番4号 八重洲桜川ビル4F\n株式会社ブルーオーシャン 暇72宛','2014-01-18T22:56:10Z',151000),('UCr2ou3CZKkkIqyXNEgyxj5g','CYCLIK','Привет братишка, я Руслан (суслик) на моём канале ты сможешь увидеть угарные и качественные видосы про тачки и не только!\nЕсли хочешь круто провести время и поднять себе настроение, то жми на колокольчик и подписку.\nРолики выходят каждый день, подписывайся бро!','2013-09-11T14:16:58Z',188000),('UCr3cBLTYmIK9kY0F_OdFWFQ','Casually Explained','If you\'re looking for the answers to life\'s questions and Wikipedia was under scheduled maintenance, look no further, Casually Explained is here to help.\nhttps://www.twitch.tv/casuallyexplained','2015-12-07T22:39:35Z',3050000),('UCR3eHnvTsH8v3Bf_DQWr72w','SS-circuit','ご覧いただきありがとうございます(*^▽^*)\n\nここはスポーツバイクの魅力を自身の遊びを通して伝えるチャンネルです♪\n\nよろしければチャンネル登録をお願いいたします(^_-)-☆\n\n☆歴代メインバイク☆\n\n【ホーネット250】2003年頃に中古で購入した人生初単車。250に見えないイカしたルックス！公道走行のみでした。\n\n【CBR600RR】2005年にホーネットから乗り換えの新車国内仕様。motoGPでロッシや玉田誠が乗っていたRC211Vの影響。このバイクでツインリンクもてぎを初走行し、「自分にはサーキット走るなんて向いてないんだ・・・」と心がへし折れる。その後ライディングスクールにて膝スリを習得するも180キロリミッターに不満をもつ。\n\n【GSX-R600】2007年に新車購入のフルパワー仕様。初めて200km/hの世界を体験した。スポーツ走行の「初級編」で面倒をみてもらったバイク。しかしオーバーレブのさせ過ぎでエンジンを壊した！この頃モテギで2分22秒位だった。\n\n【GSX-R750】2009年モデルを2010年に新車購入。このチャンネルの主役バイク。動画撮影を開始し、走りもスキルアップさせてもらった！ドノーマルでモテギを初めて走って2分19秒、その後さまざまなカスタムを経て2分9秒となった。2018年に乗り換えとなったが、8年も乗り続けた理由は言うまでもない。\n\n【GSX-R1000R】ついにリッターSSに手を出しました！2018年ワークスカラー国内仕様（フルパワー）。これからはこのバイクが主役となってチャンネルを盛り上げていく予定です！大破させなければね・・・\n\n\n☆歴代セカンドバイク☆\n\n【CRF250M】公道走行の乗りやすさとミニサーキットでの楽しさを求め2013年新車購入。2台持ちの便利さを教えてくれたバイクでガンガンカスタムしちゃった。\n\n【200DUKE】2015年新車購入。小排気量でミニサーキットを攻める楽しさを教えてくれたバイク。エンジンパワーを使い切って攻める感覚が最高だわ！大型で攻めるのとはまったくの別腹。\n\n【DトラッカーX】もう一度モタードに！ということで2017年に中古購入。しかも2008年モデルを・・・街中でも見た目カッコよく！ミニサーキットでも楽しい！','2012-11-30T13:39:24Z',42400);
