rld. Check out her Channels to be part of the Cher-Lloyd-World.\n\nListen here: https://www.cherlloyd.de/','2010-10-11T04:51:17Z',2660000),('UCrAq8h6Q3xGxzUC-84YD9PQ','BobSappAim','PUBGPARK15回以上優勝！DONCUP5回以上優勝！ \nリンク一覧\n◇Twitter   【 https://twitter.com/BobSappAim0304?la...\n◇Amazon 欲しい物リスト【 https://www.amazon.co.jp/gp/registry/search.html?ie=UTF8&ref_=nav_wishlist_gno_listpop_find&type=wishlist】\nエゴサは #BobSappAim 絵は #Bobアート','2015-03-30T10:29:52Z',171000),('UCrbk16rcLEOmqRzPH185ToA','PlaneteGT TV','La chaîne 100% Automobile du site Planete-GT.com. Retrouvez des essais, des reportages et autres vidéos exclusives.','2013-05-09T02:57:48Z',128000),('UCRCMNm2I4tM4BTmNSboc4QA','Domingo','J\'ai jamais été très bon pour les descriptions mais tu trouveras ici des vidéos divertissantes et les best of de mes streams sur Twitch !','2013-06-15T22:03:18Z',646000),('UCrcqCDrC5nn-8KrbzUNrvSA','ナカイド / 激辛ゲームレビュー','ゲームを辛口で紹介するチャンネルです。炎上したゲームや、クソゲー、バグゲーと呼ばれるゲームを中心に投稿。','2020-06-09T02:44:58Z',152000),('UCrCWuRILaAIFYXqXVn8YWVw','Sweet Science Boxing LABO [SSBL]','','2017-02-25T13:17:02Z',21000),('UCrDEIr6NT9E4l2ckO_yx9dg','MousKVEVO','','2019-04-22T20:43:50Z',86),('UCReaB8qT601BFDDw6Pnymvw','くーねる','自然がわりと好き。\n命短し日々を大切に。\n\nlikes nature\nLife is short. Cherish every day','2017-04-24T13:21:18Z',208000),('UCReLl7djAZraKGApraWg6Ng','KP garage','素人我流チャンネルです。\n現在はjzx100チェイサーを所有しているので、チェイサーの加工動画がメインになります。\nちなみにガレージは持ってません。\nTwitterはじめました！\nhttps://twitter.com/KP_garage','2016-02-09T14:29:17Z',146000),('UCrFB54bqp8sda4udJyNswlA','DJKhaledVEVO','DJ Khaled on Vevo - Official Music Videos, Live Performances, Interviews and more...','2010-02-15T11:12:08Z',5080000),('UCrFHReUjGMKUKIUgl04GgPA','Meltingcurlz','Hello et bienvenue sur ma chaîne ! Je m\'appelle Jessy Martias et je partage ici des vidéos lifestyle, crash test, mode, beauté... etc !\nBon visionnage ?\n\n♥ Instagram : http://instagram.com/Meltingcurlz\n♥ Twitter : http://twitter.com/Meltingcurlz\n♥ Facebook : http://www.facebook.com/MeltingCurlz/\n♥ Site web : www.meltingcurlz.com\n\nContact pro : Jessy@sunymanagement.com','2017-01-04T02:26:45Z',257000),('UCrFkS_LZfUIJw3YC7ghrKNQ','Larva Rewind','Welcome to the channel. \nOur youtube channel is a compilation of videos from the Larva animated film. Hope you support us. Wish you have fun watching movies. \nFollow me: \nFan Page : https://www.facebook.com/cartoonfunnyfilm\nYoutube: youtube.com/channel/UCrFkS_LZfUIJw3YC7ghrKNQ\nIG: https://www.instagram.com/i_am_larvatuba/\nTW: https://twitter.com/IamLarva \nWebsite: http://tubaani.com/\n? All videos on the channel are licensed by the copyright owner\nRemember to press the bell ? to get notifications to update good videos every day! Thank you for watching ♥♥♥\n#New_Larva_2020  #Larva_Rewind #LarvaRewind','2020-04-03T01:57:29Z',0),('UCRfLYjEPxwkS72HN3eC-Wng','DA Uzi','','2013-12-28T17:06:42Z',497000),('UCRFQKOcDYYABhmYq4qvkF-g','HLG machinery','Bonjour à toutes et à tous, vous êtes les bienvenus sur la chaine HLG machinery. Je suis un jeune passionné du machinisme ,des nouvelles technologies et de l\'agriculture mécanisée dans le monde. \n\nCes trois passions m\'ont poussé à lancer m\'a chaine Youtube où vous retrouvez toutes les vidéos de machinisme que je réalise. Ces vidéos présentent les solutions de mécanisation agricole en Europe, essentiellement en France. N\'hesitez pas à vous abonner et à partager la chaine autour. \n\nVous pouvez également présenter à vos amis certaines vidéos qui suscitent de nombreuses réactions comme la récolte de carottes en baie du Mont-Saint-Michel (Janv 18). Ce moment sera un échange agréable autour d\'un petit saucisson  et d\'une chopine de bière.','2014-10-22T21:13:16Z',208000),('UCrGnb5RdHA9M6WGmBGYo4ZQ','AM3NlC','Salve seres humanos faço videos de Minecraft eu sou EduKof e seja bem vindo ao canal AMENIC!\n\nCONTATO COMERCIAL: contato-edukof@hotmail.com','2012-12-15T02:44:30Z',13700000),('UCrGPz6YlvFnNRx_TlheGjpw','わっきゃい','暇つぶし日記\ntwitter @wildkumada','2013-04-02T00:28:42Z',582000),('UCrGVM2usyKraDO24lq6_bUw','小原正子','こんにちは！\n\n小原正子です。よろしくお願いします?','2015-09-04T07:52:32Z',48500),('UCrHP6O8ZiyBOVwU7JzmVgrQ','Guep','Hey !\nMa chaîne est composée d\'UHC (jeu pvp sur Minecraft où le but est d\'être le dernier ou la dernière équipe survivante après une phase de préparation) en grande majorité. Je joue également à d\'autres modes de jeu plus stratégiques comme le Loup-Garou UHC ou Taupe Gun !\n\nQuestions fréquentes :\n\n- Avec quoi tu filmes ? OBS Studio\n\n- Avec quoi tu montes ? Adobe Premiere Pro\n\n- C\'est quoi la config de ton PC ? GTX 2080 Ti, AMD Ryzen 9 3900X (3.8 GHz), RAM 2x16 Go\n\n- Ajoute moi sur Skype/On peut faire des UHC avec toi/Tu m\'ajoutes en ami ? Non.\n\n- T\'as quel âge ? 19 ans\n\n- Tu rec ? Toujours.\n\n- Tu stream ? : Je stream assez régulièrement sur Twitch ! \n\n- C\'est quoi ton pack ? Regarde dans la description de la vidéo, je le mets toujours\n\nPP par : Zordy (https://twitter.com/ZordyDzN_)\nBannière par : Zordy (https://twitter.com/ZordyDzN_)','2013-03-27T13:21:05Z',173000),('UCrht-oKwaPy5TqVp80yOuLg','Perfume - Topic','あ～ちゃん・かしゆか・のっちからなる3人組ユニット。\n2000年に広島で結成し、2005年にメジャーデビュー。\n2007年にシングル「ポリリズム」がブレイク、独自な楽曲・歌詞・ダンス・MCなどで多方面から評価を得る。\n\n近年の代表作に、映画「ちはやふる」の主題歌「FLASH」（2016年）、テレビドラマ「東京タラレバ娘」の主題歌「TOKYO GIRL」（2017年） など数多くのヒット曲がある。\n\n2019年2月より、自身4度目のワールドツアー「Perfume WORLD TOUR 4th “FUTURE POP”」を開催。同年4月、世界最大級の音楽フェス「Coachella 2019」に出演。2019年9月、初のベストアルバム「Perfume The Best “P Cubed”」をリリース。2020年2月、同作を携えて全国4大ドームツアー「Perfume 8th Tour 2020 “P Cubed”」を開催した。','2013-07-20T02:06:00Z',26600),('UCrHv5lkcZRl03vp7YoNJ_tQ','DossehVEVO','','2014-09-30T19:49:24Z',826000),('UCrHVgoOZ-2Eke0Kzxxw6Dmg','Didek 74','','2018-12-13T21:10:42Z',269000),('UCRhyS_ylPQ5GWBl1lK92ftA','Léo - TechMaker','Salut c\'est Léo de la chaine TechMaker !\nLe maitre mot de cet endroit ? N\'arrêtez jamais d\'apprendre !\nVous retrouverez ici des tests de nouveaux produits, que ce soit de grosses marques comme Apple, Samsung, Huawei, Xiaomi, OnePlus et tant d\'autres !\nJe fais aussi pas mal de D.I.Y., par exemple comment construire une Nintendo Nes, une Nintendo Switch ou bien une borne d\'arcade ?\nEnfin, je parle de l\'actualité, toujours dans le domaine de la technologie, histoire d\'en savoir toujours un peu plus sur ce monde ?\n\nAlors si vous voulez deux doses de vidéos intelligentes par semaine, le mercredi & le samedi à 18 heures, abonnez-vous !','2015-11-23T00:31:45Z',540000),('UCRI00CwLZdLRCWg5BdDOsNw','The Canadian Lad','I am all about Marvel movies. I am deeply into Marvel comics and Marvel Cinematic Universe. I make videos about movie theories, reviews and Easter Eggs.\n\nP.S: I wasn\'t born in Canada. I\'m an immigrant here. So if I don\'t sound Canadian enough, please apologize my accent. I hope to improve with every new video!\n\nIf you wanna reach me out for Marvel related theories/ideas: thecanadianbrat@gmail.com\nFor all business related inquiries: thecanadianlad@ellifyagency.com\n\nThank you.','2018-07-07T07:56:26Z',457000),('UCrie6ZLzuerXq7I68EgYdwQ','iMachines TV','Hey Friend, you can see The Most Satisfying ASMR, ASMR Sounds, ASMR Videos,... new videos updated daily from iMachinesTV! \n\nWe Hope You Will Enjoy This Oddly Satisfying Videos! Don\'t Forget To Subscribe! Thank You Very Much!\n\nSubscribe: http://bit.ly/Subscribe_iMachinesTV\nInstagram: https://www.instagram.com/imachinestv/','2017-04-17T09:34:21Z',129000),('UCRikOxqoMl84v0R0M2C9iww','Sofia Play','','2019-07-02T03:21:40Z',1550000),('UCRJR3c7PvFnPsVfD-VWZdUQ','なるなる王国','【なるなる王国のお城】\nサブチャンネルも登録してね\n\n【なるなる王国の物語】\n2018/11/28 初投稿\n2019/1/20 チャンネル登録者100人達成\n2019/4/4 チャンネル名の変更\n2019/5/14 200人\n2019/5/26 300人\n2019/5/31 400人\n2019/6/3 500人\n2019/6/13 600人\n2019/6/14 700人\n2019/6/15 800人\n2019/6/17 900人\n2019/6/20 1000人\n2019/8/21 2000人\n2019/8/25収益化達成\n2019/9/16 3000人\n2019/10/5 4000人\n2019/10/11 5000人\n2019/10/25 6000人\n2019/11/5 7000人\n2019/11/8 8000人\n2019/11/9 9000人\n2019/11/10 1万人\n2019/11/25 2万人\n2019/12/15 3万人\n2020/1/31 4万人\n2020/7/5 4万人\n