r!\"\n\nSo if you\'re driving a truck, please let these videos be a warning not to argue with low bridges. They have the law (of physics) on their side. Just heed the warnings and drive a different route. Be safe, y\'all.\n\nIf you like the video s on this channel, please consider supporting us on Patreon: https://www.patreon.com/11foot8','2007-02-10T01:44:25Z',124000),('UCXx4JOplhv8nLKGm7bN_FTA','123 GO! CHALLENGE French','Pour les demandes de partenariat avec des marques : brands@thesoul-publishing.com','2019-08-27T07:47:24Z',491000),('UCXXBi6rvC-u8VDZRD23F7tw','Need for Speed','The official home for Need for Speed on YouTube.','2006-02-08T22:47:00Z',1260000),('UCxYYvG9TujC_ig5Hp90qtqA','H5 Motivation','Pour ceux qui souhaitent développer leur potentiel et qui ont besoin de motivation\n\nH5 Motivation, propose des musiques de motivation associer à des vidéos de motivation en français !\n\nMusique motivante pour:\n\n Motivation musculation\n Motivation crossfit\n Tabata songs\n Motivation rugby\n Motivation perte de poids \n Motivation sport divers \n        Motivation étude \n\nH5 Motivation, les vidéos de motivation pour réveiller le meilleur en toi.','2017-05-30T16:31:26Z',720000),('UCxZ0BkYadR-0LtmkrHcFOvQ','せろりんね','＼Welcome to my channel!!／\n\nやぁ、せろりんねと申す！関東住みの23歳女です。\n\n\n2017.03.15　動画投稿開始\n03.29　チャンネル誤BAN　⇒ 一日で復活\n04.25　登録者数1000人突破!\n05.06　5000人突破!\n05.08   10000人突破!\n\nありがとうございます!\n\n※せろりんねは、amazon.co.jpを宣伝しリンクすることによってサイトが紹介料を獲得できる手段を提供することを目的に設定されたアフィリエイト宣伝プログラムである、Amazonアソシエイト・プログラムの参加者です。','2016-01-07T14:59:09Z',239000),('UCXzdvY4dU-W5e7FGY8EeLkA','LOdoesmakeup','Pour me contacter :\nlodoesmakeup.blog@gmail.com','2011-07-12T19:04:01Z',213000),('UCXZH06-YIPDUJ25T8fODqgQ','Hydro','21. french. vroom vroom. Racing videos. \n\nJe suis souvent en retard donc check l\'onglet \"communauté\" pour être au courant.\n\nBanner made by: https://twitter.com/cript0n','2014-03-28T16:40:56Z',63900),('UCXzmMkXaHxMVlutDBD8goHA','Elhiwar Ettounsi','Retrouvez tous les replays